import React, { Component } from 'react';
import { connect } from 'react-redux';
import './PartieInformationStylesheet.js';
import Subject from '@material-ui/icons/Subject';
import HowToVote from '@material-ui/icons/HowToVote';
import EventSeat from '@material-ui/icons/EventSeat'

class PartieInformation extends Component {
  render() {
    return (
      <div style={styles.mainChild}>
        <div style={styles.partieInformationContent}>
          <h3>{this.props.currentPartie.party_name} : {this.props.currentPartie.description}</h3>
        </div>
        <div style={styles.optionsContainer}>
          <Subject style={styles.optionElem} />
          <HowToVote style={styles.optionElem} />
          <EventSeat style={styles.optionElem} />
        </div>
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    currentPartie: state.parties.currentPartie
  };
}

function mapDispatchToProps(dispatch) {
  return { };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(PartieInformation);


